    {
      bgcolor: "red",
      padding: "10px",
      link1: "",
      link2: "",
      link3: "",
    },
  ]);
  const [getHeader, setHeader] = useState({
    image:
      "https://lightfoottravel.imgix.net/public/destination/croatiadubrovnik.jpg",
    text: "Croatia",
    height: "400px",
  });

